      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n\"@context\": \"https:\/\/schema.org\",\n\"@type\": \"FAQPage\",\n\"mainEntity\": [{\n\"@type\": \"Question\",\n\"name\": \"What makes a business logo good or bad?\",\n\"acceptedAnswer\": {\n\"@type\": \"Answer\",\n\"text\": \"A good \\u003ca class=\\\"external\\\" href=\\\"https:\/\/www.designhill.com\/logo-design\/\\\"\\u003ebusiness logo\\u003c\/a\\u003e has three meaningful aspects — telling the potential buyers if a product is suitable for them, communicating a brand's message, making the audience remember your business for a more extended period. \nThe best way to create a logo which communicates this info is to get logo ideas and inspiration from competitors and the world’s best brands. Work with a professional designer. A logo designer would be able to suggest you relevant colors, shapes, typefaces, and other elements to send out the right message. \n\"\n}\n}, {\n\"@type\": \"Question\",\n\"name\": \"What will I get with my logo design?\",\n\"acceptedAnswer\": {\n\"@type\": \"Answer\",\n\"text\": \"With your cool\\u003ca class=\\\"external\\\" href=\\\"https:\/\/www.designhill.com\/logo-design\/\\\"\\u003e logo design\\u003c\/a\\u003e, you will get ready-to-use industry standard files including:  \nPNG Files – These files often come with a transparent background. That means placing your logo over a colored background will not be overlapped. The colored background will appear around the logo design. PNG files are perfect to use with websites and marketing materials having a colored background.  \nJPG Files — These files are different from PNG files. A JPG file comes with a white background around the logo. As compared to PNGs, JPGs are less used. It is used in the cases when you have to place your logo on a white background. \nEPS Files — An EPS file comes handy when there is a need for a vector file. You get this file when you request specifically for it. For that, you need to make sure that you work with a professional logo designer. \nIn addition, you get your logo design with BM files (black and white) and 400dpi versions as well. Use the 400dpi version file when you want to use the logo for printed materials. \n\"\n}\n}, {\n\"@type\": \"Question\",\n\"name\": \"Do I need to prepare something for my logo design?\",\n\"acceptedAnswer\": {\n\"@type\": \"Answer\",\n\"text\": \"You need to get a lot of ideas! For more inspiration, explore Designhill's examples of logos. Create a brief in advance and add as many specifics as you can. Plus, include your brand details, designs for reference, typeface info, logo colors, product photos, style, and other details that would have a significant effect on your logo design. The more design specifics you provide, the better the logo design! \n\"\n}\n}, {\n\"@type\": \"Question\",\n\"name\": \"How can I get more logo variations?\",\n\"acceptedAnswer\": {\n\"@type\": \"Answer\",\n\"text\": \"There are several ways to get more \\u003ca class=\\\"external\\\" href=\\\"https:\/\/www.designhill.com\/tools\/logo-maker\/\\\"\\u003e logo \\u003c\/a\\u003e evariations. You can get it by:\n•\tSelecting second or third winning design from the submitted designs\n•\tWorking with the winner of the contest for a one-to-one project•\tPosting a new contest \n\"\n}\n}, {\n\"@type\": \"Question\",\n\"name\": \"Can I get more than just a logo?\",\n\"acceptedAnswer\": {\n\"@type\": \"Answer\",\n\"text\":\"Yes, you can get more than a logo design. You can get one of our combos or boundless, and save big money. You can get a website, a business card, or \\u003ca class=\\\"external\\\" href=\\\"https:\/\/www.designhill.com\/social-media-page\\\"\\u003esocial media design\\u003c\/a\\u003e, along with your logo design. Even, you can purchase the business starter kit with our Brand Identity Pack. Explore our other design categories for more logo ideas, inspiration, and packs. Or look for a designer on our platform who can create brand identity materials for you. \"\n\n}\n}]\n}\n\u003C\/script\u003E",
