      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"How to buy custom tank tops at Designhill?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Buying custom tank tops at \\u003ca class=\\\"external\\\" href=\\\"https:\/\/www.designhill.com\/\\\"\\u003eDesignhill\\u003c\/a\\u003e is a seamless process. You just need to visit our site and choose your requirements. The online store has a wide range of personalized products including men’s, women’s, kids and youth clothing like customized tank tops, t-shirts etc. to choose from. Once you’ve chosen the type of clothing you want to customize, you’ll need to select the color, quantity, size, shape, etc. Next steps will include either picking any of our pre-defined artworks or uploading your own. Once you’re done with it, you can preview mockups if you’re curious to see how it will actually look after printing.\nIf you're ok with the preview, you can choose a delivery method and proceed to make the payment. The shipment will be delivered to your doorstep within the stipulated time, depending upon your geographical location.\nWe accept almost all major credit and debit cards such as MasterCard, Visa, Maestro, AMEX, and Discover. We also accept payments through PayPal.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Can I mix the sizes of the tank tops in my order?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, when you design your own tank top, you can mix different custom design tank top sizes in one order. But it’s essential to keep in mind that the logo or design that you want to print must be made to fit the smallest tank tops in the order.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What are different types of tank tops brands available?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Designhill is one of the biggest online stores for customized tank tops \u0026 other apparels, and it always keeps adding new collections. You can design your own tank top in very simple steps. As of now, some of the major brands available for sale are — American Apparel, Gildan and Bella+Canvas.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What is your minimum order quantity?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"We haven’t restricted our customers as far as the minimum order quantity is concerned. You can order as many custom tank tops as you want or your need may be. It can be as low as one piece or as many as tens of thousands.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"How can I make sure that my design is centred on my custom tank tops?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"You can make sure that when you create your own tank top,  your design item is placed in the center of your tank tops. Once you’ve uploaded\/selected your design, tap the horizontal icon to center horizontally and straighten icon for vertical. You can find these icons in the Edit panel.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What resolution do custom tank top design needs to be uploaded for printing?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"You're always advised to upload a high-resolution design for customized tank tops to get good quality printing. When you make your own tank top, just be sure that custom design for personalized tank tops doesn't get blurred when uploaded. Your print files should be at least 150 DPI and at actual size. You can check the quality of your personalized design by using DPI meter in the edit panel.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Can I upload my own artwork to make cool tank tops?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, you can upload your own artwork to make your own cool tank tops. Under the “Add Art Work” tab in the Edit panel, there’s ‘Upload Your Own’ button by clicking which you can submit your own artwork. Make sure the custom design is of high-resolution and does not get blurred. This will help you get high-quality custom printed tank tops design.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Will I preview my personalized tank tops design before I order it?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, Designhill \\u003ca class=\\\"external\\\" href=\\\"https:\/\/www.designhill.com\/t-shirt-printing\\\"\\u003et-shirt printing\\u003c\/a\\u003e tool allows you to preview your custom tank tops design before you finally make a tank top and place the order. It will give you a feel of how your custom design tank tops will actually look after printing.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Will others reuse my personalized tank tops design? If yes, will I get any amount for it?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"No, you have full copyright on your personalized custom tank tops design; and hence, no one will ever reuse your design without your permission. However, if you want to sell your personalized artwork, you can do that on the Designhill marketplace. For more information, please visit \\u003ca class=\\\"external\\\" href=\\\"https:\/\/www.designhill.com\/sell-your-art\\\"\\u003e Sell Your Art.\\u003c\/a\\u003e\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"How much does it cost to get custom tank tops printed?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Price is calculated automatically, based on the product and quantity you choose. You will find the price of every custom tank top given along with it. Size also contributes to its price.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What types of printing does Designhill offer to design \u0026 create a tank top?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"There are plenty of printing options to get custom printed tank tops today, but Designhill uses the two most popular printing methods— Screen printing and Direct-to-Garment printing.\n Screen Printing: We use it for bulk orders. If the order is for more than six pieces of garments, we print them using this technique. In this method of printing, only one color can be applied at a time which restricts the number of colors on a t shirt. Therefore, Screen printing method is widely used for simple personalized tank tops that requires only one color, or when you've to print a large number of custom tank tops of the same design.\n Direct-to-Garment: We usually use this technology to print the majority of our casual and cool tank tops but when the order is of less than six garments. It allows printing images in much higher detail than screen printing and doesn’t restrict in color. Since it can print any image, you get plenty of customization options to create a tank top.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Do I get charged for the delivery of each tank top order?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, all orders attract a certain delivery charge, depending on the volume of order and the geographical location. View a tentative shipping charge of your order.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"When will it be delivered?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Shipping speed of your order of personalized tank tops will entirely depend on the geographical location of your residence. View a tentative shipping time of your order.\"\n    }\n  }]\n}\n\u003C\/script\u003E",
