      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"Can I print on the sleeves of my custom t-shirt?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, you can print on the sleeves of your custom t shirts. Designhill has recently introduced a feature to the new interface which lets customers print on either of the sleeves, front, back, outside label, or inside label of their custom tees. The process is extremely seamless. Just choose the t-shirt that you want to print and select one option (left sleeve or right sleeve) from the left panel. Now, you can add your artwork or text using the right panel. If you don’t have a design of your own, you choose one from our predefined artwork.\n\nOnce you’re satisfied with the design and curious to see how it will actually look after printing, you can preview mockups. Now, your custom t shirts will be ready in minutes! Click to give our t-shirt printing tool a try. Once you’re satisfied with the design and curious to see how it will actually look after printing, you can preview mockups.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Can I mix the sizes of the custom t-shirts in my order?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, you can mix different custom tee shirts sizes in one order. But it’s essential to keep in mind that the logo or design that you want to print must be made to fit the smallest custom t-shirt in the order.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"How to buy custom clothes at Designhill?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Buying custom clothes at Designhill is a seamless process. You just need to visit our site and choose your requirements. The online store has a wide range of products including men’s, women’s, kids and youth clothing to choose from.\n\nOnce you’ve chosen the type of clothing you want to customize, you’ll need to select the color, quantity, size, shape, etc. Next steps will include either picking any of our pre-defined artworks or uploading your own. Once you’re done with it, you can preview mockups if you’re curious to see how it will actually look after printing.\n\nIf you’re ok with the preview, you can choose a delivery method and proceed to make the payment. The shipment will be delivered to your doorstep within the stipulated time, depending upon your geographical location.\n\nWe accept almost all major credit and debit cards such as MasterCard, Visa, Maestro, AMEX, and Discover. We also accept payments through PayPal. Shopping custom tshirts is just a matter of a few clicks.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What are different types of t-shirt brands available?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Designhill is one of the biggest online stores for customized apparel such as custom shirts, and it always keeps adding new collections. As of now, some of the major brands available for sale are — American Apparel, Gildan, Anvil, Next Level, Hanes, Bella+Canvas, and many more.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What is your minimum custom shirts order quantity?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"We haven’t restricted our customers as far as the minimum order quantity is concerned. You can order as many custom t shirts as you want or your need may be. It can be as low as one piece or as many as tens of thousands.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"How can I make sure that my design is centered on my custom t-shirt?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"You can make sure that your design is placed in the center of your custom tshirt. Once you’ve uploaded\/selected your design, tap the horizontal icon to center horizontally and straighten the icon for vertical. You can find these icons in the Edit panel.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What resolution do designs need to be uploaded for printing on custom shirts?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"You’re always advised to upload a high-resolution design for good quality t-shirt printing. Make sure the design doesn’t get blurred when uploading. Your print files should be at least 150 DPI and at actual size. You can check the quality of your design by using DPI meter in the edit panel.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Can I upload my own custom shirts artwork?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, you can upload your own artwork for custom tee shirts. Under the “Add Art Work” tab in the Edit panel, there’s ‘Upload Your Own’ button by clicking which you can submit your own artwork. Make sure the design is of high-resolution and does not get blurred.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Will I preview my design before I order it?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Yes, Designhill’s t-shirt printing tool allows you to preview your design before you finally place the order. It will give you a feel of how your custom t-shirt will actually look after printing.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Will others reuse my designs? If yes, will I get any amount for it?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"No, you have full copyright on your design; and hence, no one will ever reuse your design without your permission. However, if you want to sell your artwork, you can do that on the Designhill marketplace\"\n    }\n  }]\n}\n\u003C\/script\u003E",
