      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E\n{\n  \"@context\": \"https:\/\/schema.org\",\n  \"@type\": \"FAQPage\",\n  \"mainEntity\": [{\n    \"@type\": \"Question\",\n    \"name\": \"How are custom mugs printed?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"We inkjet print your design with the help of dye-sublimation inks as well as transfer paper. The photo\/image on the paper is then printed mirrored, and the paper is draped around the mug. The ink is mixed with the coating the design becomes a part of the mug when heat and pressure are applied onto it to transfer the image\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Are the custom printed mugs microwave and dishwasher safe?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"As far as our white mugs are concerned, they are dishwasher and microwave safe. However, our matte black magic mugs should only be hand washed. Also, you shouldn’t put them in a microwave. Please note that they are prone to scratches; therefore, you need to be a little careful.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What is the difference between the traditional 150 DPI templates and the latest 300 DPI templates?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"We have updated our templates to offer optimum quality for your custom mugs. Everyone likes holding mugs up close. So the more detailed the design, the higher will be the resolution. That is the reason, we recommend 300 DPI. However, 150 DPI is also okay.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"What do I do if I receive a broken mug?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"If you unpack the package and find your custom mug broken, please contact our customer support at +14158533655. We will send you a new one.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"Do the custom mugs come in other colors except white and black?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"As of now, we have only white and black colored custom mugs. However, we are working to offer other colors. Once they are available with us, we will notify you in advance.\"\n    }\n  },{\n    \"@type\": \"Question\",\n    \"name\": \"How big will you print my logo or design on a custom mug?\",\n    \"acceptedAnswer\": {\n      \"@type\": \"Answer\",\n      \"text\": \"Due to limited imprint area, we reserve the right to resize your artwork to fit the space of the product ordered. The size of the submitted artwork, such as a logo, doesn't matter. But if you request a specific print size, we'll comply; however, it should not exceed the maximum imprint size of the product.\"\n    }\n  }]\n}\n\u003C\/script\u003E",
